The main function:
- Measure and record motion data in real time, and provide weekly or monthly motion trend graphs to make the movement situation clear at a glance;
- Detect sleep data, record the length of deep sleep, shallow sleep time, help users understand their sleep in real time;
- set the bracelet after connecting the bracelet, you can carry out a number of personalized settings such as call alert, smart alarm, sedentary reminder, step number, etc., to provide more convenience for the user's life;
- record your riding, running, etc., visualize the results of the data, let you know your own movements;
- you can connect the synchronization data to Apple Health, to achieve data movement, the user's steps, calories, distance, heart rate and other data will be synchronized;

Note:
- Support [health] application, you can synchronize the number of steps, calories and distance to the [health] application after authorization.
- Continuous running GPS in the background may reduce your battery life

Желаете обрести стройную фигуру? Для этого не обязательно ходить в зал и заниматься с тренером! При правильном подходе к упражнениям домашние тренировки могут быть не менее эффективны, главное - ваше желание и дисциплина. 

Summer Fit - это приложение, разработанное для того, чтобы помочь вам привести тело в форму при размеренных домашних тренировках. Каждое упражнение сопровождается видео инструкцией, которая поможет выполнять его правильно. Вы можете заниматься дома в любое время, экономя деньги на походах в спортзал и выстраивая свой день так, как вам будет удобнее. Упражнения составлены таким образом, что занимают не более 10 минут при острой нехватке времени. Составьте свой индивидуальный план тренировок, прорабатывая как отдельные проблемные зоны, так и все тело целиком. 

А в разделе "Статьи" вы найдете полезные советы, которые помогут вам в достижении вашей цели - подтянутое и здоровое тело. 

Основные особенности: 
- все упражнения разнообразные, не требуют подключения интернета; 
- экономят время;
- без спец оборудования;
- подходят для тех, кто хочет снизить нагрузку на определенные части тела (например, на колени); 
- группировка упражнений в комплексы по проработкам проблемных зон; 
- приложение содержит сеты с разминкой и заминкой после основного комплекса упражнений.

Мобильное приложение "ЛакиМедиа медитация и сон" направлено на изучение, познание и углубление в осознанность;
Уроки медитации подходят для людей без опыта, а также для людей регулярно слушающих медитации, аффирмации и практики.
Новичкам в медитативных практиках будет предложено прослушать медитации в разделе "Медитации для начинающих" продолжительностью первых занятий не более 4 минут, эти практики помогут понять суть, постепенно углубиться и уже после перейти к серьезным медитациям

В мобильном приложении собраны все практики, помогающие работать ключевыми чувствами:
- снять стресс. Изменение в лучшую сторону, контакт с собой;
- тревога. Избавление от тревоги, работа над скрытыми причинами;
- счастье. Истинное определение и источники;
- благодарность. За что мы можем быть признательны жизни;
- принятие. Смягчение нашего сопротивления реальности;
- гнев. Избавление от гнева и негативных эмоций. Заметить, ослабить и трансформировать;
- сострадание. относиться к себе и окружающим с большей добротой и состраданием;
