Все медитации и аффирмации собраны по категориям, которые подойдут всем пользователям, ищущим:
1) Улучшить дыхание, научиться дышать, при прослушивании медитации;
2) Медитации и музыка для сна поможет расслабиться, улучшить качество сна и пробуждения, скорректируйте режим сна;
3) Аффирмации на каждый день - мы обновляем медитации каждый день, добавляем новые медитации и практики, поэтому у вас всегда будет актуальная информация;
4) Получите релакс перед сном или после тяжелого рабочего дня;
5) В приложении "Медитации на каждый день" мы собрали только лучшие звуки природы в рубрике meditation

В мобильном приложении "Медитация и сон" собраны более 500 уникальных медитаций и практик. Все медитации профессионально озвучены.
В приложении можно накладывать фоновые звуки;
Мы идеально подберем вам курс обучения исходя из ваших потребностей и опыта;
Даже если вы не знаете с чего начать, в приложении "Медитация и сон" есть базовый курс, который поможет разобраться и понять:
1. Для чего нужны медитации;
2. Как часто следует медитировать;
3. Как подобрать и нужна ли музыка для медитации;
4. Как отслеживать свой прогресс

В приложение собраны различные курсы, такие как:
• уроки медитации, принятие себя или основы для обучения медитации;
• практики по контролю гнева: энергия, импульс, контроль и польза и т.д.;
• йога для похудения или йога для начинающих на русском
• собрана отличная подборка фоновой музыки и музыки для медитации;
• все медитации разной продолжительности, выбирайте подходящий для себя в данный момент;
• практики для крепкого и здорового сна: более 100 различных практик для успокоения, здоровья и познания себя;

В мобильном приложении "Медитации и йога для начинающих" вы найдете ежедневные упражнения медитации для новичков, занятия не требуют большого количества времени;
Всего от 7 до 20 минут в день помогут вам улучшить самочувствие, поднять жизненную энергию.
